import numpy as npimport matplotlib.pyplot as pltimport pandas as pdfrom models import *from general_function import *from sklearn.metrics import mean_squared_errorimport mathdef run_lin_model(x_train, x_dev, y_train, y_dev, method='normal', alpha=0):    clf = lin_model(x_train, y_train, method=method, alpha=alpha)    preds_train = clf.predict(x_train)    preds_dev = clf.predict(x_dev)    mse_train_reg = math.sqrt(mean_squared_error(y_train, preds_train))    mse_dev_reg = math.sqrt(mean_squared_error(y_dev, preds_dev))    # print('RMSE on train is: {}'.format(mse_train_reg))    # print('RMSE on DEV is: {}'.format(mse_dev_reg))    return clf, mse_train_reg, mse_dev_reg